gulp-newer ignored `@import` in LESS files.

---

**Example**

*a.less* imported *b.less*
```less
@import "b.less";
```

If I change *b.less*,  gulp-newer does not recompile *a.less*.

---

**Source**

```less
gulp.task('less', function() {
  return gulp.src('lib/a.less')
    .pipe(newer('dist/a.css'))
    .pipe(less())
    .pipe(gulp.dest('dist'));
});
```

